import "./songCard.css"

const SongCard = ({track}) => {
    return(
        <div className="songCard">
            <div className="songCardImageCont">
                <img src={track.album.images[0].url} className="songCardImage"/>
            </div>
            {track.name}
        </div>
    )
}
export default SongCard
